import React from 'react';
import styled from "styled-components";
import $ from "jquery";

const Main = styled.div`
  padding-top: 109px;
  background: #222;
`

const BgRow = styled.div`
  background: rgb(34,34,34);
  background: linear-gradient(90deg, rgba(34,34,34,1) 0%, rgba(34,34,34,1) 50%, rgba(243,243,243,1) 50%, rgba(243,243,243,1) 100%);
`

const Row = styled.div`
  display: flex;
  padding-top: ;: 50px;
`

const WorkItem = styled.div`
  width: 50%;
  display: flex;
  flex-direction: column;
  text-align: center;
`

const WorkItemImg = styled.img`
  width: 80%;
  margin: 0 auto;
  border-radius: 5px;
`

const WorkItemName = styled.h2`
  margin: 20px 0 10px 0;

  a{
    text-decoration: none;
    color: inherit;
  }
`

const WorkItemDesc = styled.p`
`

const OurWork = () => {
    $('.active').removeClass('active');
    $('#work').addClass('active');
    return (
        <Main>
            <BgRow>
            <div className={'container'}>
                <Row>
                    <WorkItem>
                        <WorkItemImg src={'./img/alum-wallet.png'} />
                        <WorkItemName><a href={'https://homerioni.github.io/alum-wallet.github.io/'}>Алюминиевый кошелек</a></WorkItemName>
                        <WorkItemDesc></WorkItemDesc>
                    </WorkItem>
                    <WorkItem>
                        <WorkItemImg src={'./img/led-alarm.png'} />
                        <WorkItemName>Алюминиевый кошелек</WorkItemName>
                        <WorkItemDesc></WorkItemDesc>
                    </WorkItem>
                </Row>
            </div>
            </BgRow>
        </Main>
    );
};

export default OurWork;
